import React from 'react';
import './components.css'; // Importando o arquivo CSS local

function ProcessedImage({ image }) {
  // Verifica se `image` não é nulo e se `image.data` não é nulo ou indefinido
  const imageData = image && image.data ? image.data : null;
  const imageType = image && image.type ? image.type : 'image/jpeg'; // Define um tipo padrão se `image.type` for nulo ou indefinido

  return (
    <div className="processed-image-container">
      <h2>Processed Image</h2>
      {imageData ? (
        <img src={`data:${imageType};base64,${imageData}`} alt="Processed" />
      ) : (
        <p>No processed image.</p>
      )}
    </div>
  );
}

export default ProcessedImage;
